    return (
        <ul className="footerList">
            <li className="footerLink">
                <a href="https://linkedin.com/in/bruno-baptista5"><LinkedInIcon /></a>
            </li>
            <li className="footerLink">
                <a href="mailto:baptistabruno5@gmail.com"><EmailIcon /></a>
            </li>
            <li className="footerLink">
